$(document).ready(function() {
	
	if( /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent) ) {
		$(".project a").addClass("prevent-redirect");
	}

	$("#hamburger-menu").click(interface.openMenu);
	$("html").on("focus", ".input", function() { interface.inputEnter( $(this) ); })
	$("html").on("blur", ".input", function() { interface.inputLeave( $(this) ); })
	$("html").on("click", ".submit-form", function() { interface.submitForm( $(this) ); })
	
	$("html").on("click", ".placeholder", function() {
	
		var $this = $(this);
		if ( !($this).hasClass("placeholder-shift") ) {
			$(this).parent().find(".msg-input").first().focus();	
		}	
	
	});
	
	$(".filter-btn").click(function() {
		interface.filter( $(this) );
	})
	
	$("html").on("keydown", ".msg-input", function(e) {
		
		if (e.keyCode == 13) {
			e.preventDefault();
			$("#submit-msg-btn").trigger("click");
		}	
		
	});
	
	$("html").on("keydown", ".sub-input", function() {
		
		if (e.keyCode == 13) {
			e.preventDefault();
			$("#submit-email-btn").trigger("click");
		}	
		
	});
	
	$("html").on("click", ".testimonial-more-btn", function() {
		
		$(this).hide().parent().find(".testimonial-more").addClass("show");
		
	})
	
	window.addEventListener('resize', function () {
		
		waterfall('#projects');
		
	});
	
	$("html").on("mouseenter", ".project", function() {

		$("#shade").removeClass("hide");
		
		var $this = $(this);
		
		$this.find(".skill-image").each(function() {
			
			$(this).attr("src", ICONS[ parseInt( $(this).attr("data-img") ) ]);
			
		})
		
		if ( $this.find(".project-image").length > 0 ) {
			
			$this.find(".project-image").attr("src", $this.find(".project-image").attr("data-img") );
			
		}
		
	
	})

	$(".skill-image.skill-image-instant").each(function() {
		$(this).attr("src", ICONS[ parseInt( $(this).attr("data-img") ) ]);
	})
	
	$("#shade").click(function() {
		interface.closeProject();
	})
	
	$("html").on("mouseleave", ".project", function() {
		interface.closeProject();
	})	
	
	$("html").on("click", ".prevent-redirect", function(e) {
		$(this).removeClass("prevent-redirect");
		e.preventDefault();
	})
	
	$(".scroll-btn").click(function() { 
		interface.scroll( $(this).attr("data-page-id") );
	})
	
	setTimeout(function() {
		waterfall('#projects');
	}, 100);
	
		
})

var Interface = function() {

	this.isMenuOpen = false;

}

var projects = $(".project");

Interface.prototype.scroll = function( position ) {

	$("html, body").animate({ scrollTop: $("[data-scroll-page-id='" + position + "']").offset().top - 58 });
	
	if ( $("#hamburger-menu>i").first().text() == "close" ) interface.openMenu();
}

Interface.prototype.closeProject = function() {
	
	waterfall('#projects');
	$("#shade").addClass("hide");
	
	if( /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent) ) {
		$(".project:hover").first().addClass("prevent-redirect");
	}
	
}

Interface.prototype.filter = function( $this ) {

	var filter = $this.attr("data-filter");
	
	$(".selected").removeClass("selected");
	$this.addClass("selected");

	$(".project").remove();
	
	projects.each(function() {
		
		if ( $(this).hasClass(filter) ) {
			$("#projects").append($(this));
		}
		
	});
	
	setTimeout(function() {
		waterfall('#projects');
	}, 50)
		
	
	
}

Interface.prototype.inputEnter = function ( $this ) {

	$this.parent().find(".placeholder").addClass("placeholder-shift");

}

Interface.prototype.inputLeave = function ( $this ) {

	if ( $this.val() == "" ) $this.parent().find(".placeholder").removeClass("placeholder-shift");

}

Interface.prototype.submitForm = function ( $this ) {

	var id = $this.attr("id");
	$(".input-section").removeClass("error")
	var error = false;
	
	switch(id) {

		case "submit-msg-btn":
		
			var email = $("#email").val();
			var name = $("#name").val();
			var msg = $("#msg").val();
			
			if ( !interface.validate("email", email) ) {
				$("#email").parent().addClass("error"); 
				return false;
			} 
			
			if ( !interface.validate("name", name) ) {
				$("#name").parent().addClass("error"); 
				return false;
			}
			
			if ( !interface.validate("msg", msg) ) {
				$("#msg").parent().addClass("error"); 
				return false;
			}
			
			server.sendMsg( ["1", email, name, msg] );
			
			break;

		case "submit-email-btn":
		
			var email = $("#email-subscribe").val();
			
			if ( !interface.validate("email", email) ) {
				$("#email-subscribe").parent().addClass("error"); 
				return false;
			} 
			
			server.sendMsg( ["2", email] );
			
			break;

		default:
			console.log("Unknown Form")

	}

}

Interface.prototype.validate = function(type, value) {

	var result = false;

	switch (type) {

		case "email":
    		const re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    		result = re.test(value);
    		break;

		case "name":
			if ( (value.length != 0) && (value.length < 128) ) 
				result = true;
			break;

		case "msg":
			if ( (value.length > 5) && (value.length < 2048) )
				result = true;
			break;

	}

	return result;

}

Interface.prototype.openMenu = function() {

	if ( interface.isMenuOpen ) {

		$("#hamburger-menu>i").text("menu");
		$(".menu-show").addClass("col-sm-hide");	

	} else {

		$("#hamburger-menu>i").text("close");
		$(".menu-show").removeClass("col-sm-hide");

	}

	interface.isMenuOpen = !interface.isMenuOpen;

}

Interface.prototype.openNotification = function(msg, success) {
	
	interface.closeNotification();
	
	$("#notification-msg").text(msg);
	$("#notification-wrapper").addClass("notification-wrapper-open");

	if (success) {
		$("#notification-wrapper").addClass("notification-success");
	} else {
		$("#notification-wrapper").addClass("notification-error");
	}
	
	setTimeout(function() {
		interface.closeNotification();
	}, 3500);
	
}

Interface.prototype.closeNotification = function() {
	
	$("#notification-wrapper").removeClass("notification-wrapper-open");
	$("#notification-wrapper").removeClass("notification-success notification-error");
	
}

var interface = new Interface();

var Server = function() {
	
}

Server.prototype.sendMsg = function( data ) {
	
	console.log(data);
	
	$.ajax({
		url: '/assets/php/dgser.php',
		type: 'POST',
		dataType: 'JSON',
		data: {
			data: data
		},
		success: function(data) {
			
			console.log(data);
			
			if (data[0] == "1") {
				interface.openNotification("Your message has been sent successfully", true);
			} else if (data[0] == "2") {
				interface.openNotification("You have successfully subscribed to the newsletter", true);
			}
			
			$("#email, #email-subscribe, #name, #msg").val("").blur();	
			$(".placeholder").removeClass("placeholder-shift");
			
		},
		error: function(data) {

			console.log(data);
			interface.openNotification("Connection Error", false);
			$("#spinner-wrapper").addClass("hide");
		
		}
	})
	
}

Interface.prototype.loadPage = function(id, content, offline) {
	
	if (!offline)
		$(".page-section[data-page='" + id + "']").empty().append(content);
	
	$(".page-section").addClass("hide");
	$(".page-section[data-page='" + id + "']").attr("data-loaded", "true").removeClass("hide");
	$("main").attr("data-page-image", id)
	$("#spinner-wrapper").addClass("hide");
	
}

var server = new Server();

waterfall('#projects');